', 'number': 65, 'state': 'open', 'locked': False, 'title': 'Use kubeadmin instead of HTPassword user for simplicity', 'user': {'login': 'majguo', 'id': 10357495, 'node_id': 'MDQ6VXNlcjEwMzU3NDk1', 'avatar_url': 'https://avatars.githubusercontent.com/u/10357495?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/majguo', 'html_url': 'https://github.com/majguo', 'followers_url': 'https://api.github.com/users/majguo/followers', 'following_url': 'https://api.github.com/users/majguo/following{/other_user}', 'gists_url': 'https://api.github.com/users/majguo/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/majguo/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/majguo/subscriptions', 'organizations_url': 'https://api.github.com/users/majguo/orgs', 'repos_url': 'https://api.github.com/users/majguo/repos', 'events_url': 'https://api.github.com/users/majguo/events{/privacy}', 'received_events_url': 'https://api.github.com/users/majguo/received_events', 'type': 'User', 'site_admin': False}, 'body': '## Description

The PR is to resolve #64, with the following changes:

As a result, the issue is to ask removing HTPassword user (project administrator) from UI, ARM template and scripts to simplify the user experience.

* Remove asking user for project administrator credentials from UI;
* Remove project administrator related pieces from ARM template and scripts;
* Remove `htpasswd-cr.yaml` which was used for creating HTPassword identity provider;

## Testing

The following test cases have already been passed before opening the PR:

* Successfully deployed the ARO 4 cluster and the Open Liberty sample image
