sider the current license UI

## Entitled (selected by default)

![image](https://user-images.githubusercontent.com/75821/157305531-a7e5c1b8-4aa3-4bb9-b83c-727c5977bb17.png)

## Evaluation

![image](https://user-images.githubusercontent.com/75821/157305586-aa9f52d5-86d8-4eff-92d4-0ef8fc32f237.png)

# IBM requests this UI be changed to the following.

I will use pseudojson to describe the desired UI. I understand the assignee must rework this to achieve the desired "show/hide" effect depending on **Entitled** or **Evaluation** being selected.

In the following pseudojson, any element without a "text" property should be unchanged from its existing code.

## Entitled

```json
{
    "name": "ibmIdInfo",
    "type": "Microsoft.Common.InfoBox"
},

{
    "name": "ibmUserId",
    "type": "Microsoft.Common.TextBox"
},

{
    "name": "ibmUserPwd",
    "type": "Microsoft.Common.PasswordBox"
},

{
    "name": "licenseInfo",
    "type": "Microsoft.Common.InfoBox",
    "options": {
        "icon": "Info",
        "text": "Accept the <a href=\"https://ibm.biz/tWASBaseLicenseAzureVMs\" target=\"_blank\">IBM WebSphere Application Server License Agreement</a> to proceed with the deployment."
    }
}
```

In other words, the **Entitled** UI shows an **InfoBox**, followed by the IBMid UI entry fields, followed by another **InfoBox**.

## Evaluation

```json
{
    "name": "ibmIdInfo",
    "type": "Microsoft.Common.InfoBox",
    "text": "By accepting the IBM License Agreement you are accepting the Evaluation terms of the license. An evaluation deployment does not include WebSphere interim fixes (iFixes). The evaluation period runs for 60 days after which you must purchase entitlement to continue to use WebSphere."
},

{
    "name": "licenseInfo",
    "type": "Microsoft.Common.InfoBox",
    "options": {
        "icon": "Info",
        "text": "Accept the <a href=\"https://ibm.biz/tWASBaseLicenseAzureVMs\" target=\"_blank\">IBM WebSphere Application Server License Agreement</a> to proceed with the deployment."
    }
}

```

In other words, the **Evaluation** UI shows an **InfoBox** immediately followed by another **InfoBox**.





